  async function run(func) {
    const department = _d.querySelectorAll('.ant-radio-input')
    let uid = '140api8x6ac2x';
    let currencyType = 2
    for (const departmentElement of department) {
      if (departmentElement.checked) {
        uid = departmentElement.value
      }
    }
    const code = Array.from(/[A-Z0-9]{6}/g[Symbol.matchAll](_d.querySelector('#code').value), (x) => x[0]);
    console.log(code);
    let userCount = 0
    for (const codeKey in code) {
      const url = `http://8.134.128.125:352/ib_tranx_req.asp?uid=${uid}&sessionid=0&termid=0&verify=0&get_rawdata=1&cmd=rt_parse&verify=0&get_ticket=1&hk=0&pnr=${code[codeKey]}`
      console.log(url);
      if (uid === 'mfm327api09lkx') {
        currencyType = 3
      }

      const xmlString = await runAsync(url, 'GET')
      const xmlDoc = new DOMParser().parseFromString(xmlString, "text/xml");
      // console.log(xmlDoc);
      info = xmlToJson(xmlDoc)

      // console.log(xmlString);
      console.log(info);

      if (/uid.*ip/.test(xmlString)) {
        document.querySelector('.err-text').innerText = '用户身份校验不成功'
        document.querySelector('.loader').style.display = 'none'
        return
      }
      if (info.rt_parse['@attributes']['ret_value'] === "0") {
        document.querySelector('.err-text').innerText = info.rt_parse['@attributes']['err_info']
        document.querySelector('.loader').style.display = 'none'
        return
      }
      document.querySelector('.err-text').innerText = ''


      const raw_data = info.rt_parse.raw_data.text;
      // 将16进制转换为字节
      const binaryData = new Uint8Array(raw_data.match(/.{1,2}/g).map(byte => parseInt(byte, 16)));
      // 将字节转换为汉字字符串（假设编码是UTF-8）
      const decoder = new TextDecoder('utf-8');
      const rawDataText = decoder.decode(binaryData);
      // console.log(rawDataText);

      let departureCity = ''
      let destinationCity = ''
      let flight = ''
      let mode = ''
      let flightName = ''
      let flightNum = ''
      let terminal = ''
      let Aterminal = ''
      let date = ''
      let startTime = ''
      let arriveTime = ''

      //输入详细信息
      //start
      _d.getElementsByClassName('pop_information')[0].click()
      if (info.rt_parse.lines.Line?.AirLine) {
        //始达城市
        airports.replace(new RegExp('\,.*\,' + info.rt_parse.lines.Line.DepartureCity.text), function (e) {
          departureCity = e.split(',')[5]
        })
        airports.replace(new RegExp('\,.*\,' + info.rt_parse.lines.Line.DestinationCity.text), function (e) {
          destinationCity = e.split(',')[5]
        })

        //航司二字
        flight = /\w{2}/.exec(info.rt_parse.lines.Line.AirLine.text)[0]
        flightName = airlines.find(item => item.includes(flight)).slice(0, -4)
        flightNum = info.rt_parse.lines.Line.AirLine.text
        //航站楼
        terminal = info.rt_parse.lines.Line.ST.text || ''
        //目标地址航站楼
        Aterminal = info.rt_parse.lines.Line.AT.text || ''
        let year = new Date().getFullYear()
        let month = dateArr.find(item => item.value.toUpperCase() === info.rt_parse.lines.Line.Date.text.slice(2, 5)).name
        let day = info.rt_parse.lines.Line.Date.text.slice(0, 2)
        date = `${year}-${month}-${day}`
        startTime = info.rt_parse.lines.Line.StartTime.text
        arriveTime = info.rt_parse.lines.Line.ArriveTime.text
        mode = '直飞'
        _d.querySelector(`#pop_xc`).value = `${departureCity}-${destinationCity}`
      } else {
        let city = ''
        info.rt_parse.lines.Line.forEach((item, index) => {
          //始达城市
          airports.replace(new RegExp('\,.*\,' + info.rt_parse.lines.Line[index].DepartureCity.text), function (e) {
            if (index) {
              departureCity += '@' + e.split(',')[5]
              city += '-' + e.split(',')[5]
            } else {
              departureCity = e.split(',')[5]
              city = e.split(',')[5]
            }
          })
          airports.replace(new RegExp('\,.*\,' + info.rt_parse.lines.Line[index].DestinationCity.text), function (e) {
            if (index) {
              destinationCity += '@' + e.split(',')[5]
              city += '-' + e.split(',')[5]
            } else {
              destinationCity = e.split(',')[5]
            }
          })

          if (index) {
            terminal += '@'
            terminal += info.rt_parse.lines.Line[index].ST.text ?? ''
            Aterminal += '@'
            Aterminal += info.rt_parse.lines.Line[index].AT.text ?? ''
            let year = new Date().getFullYear()
            let month = dateArr.find(item => item.value.toUpperCase() === info.rt_parse.lines.Line[index].Date.text.slice(2, 5)).name
            let day = info.rt_parse.lines.Line[index].Date.text.slice(0, 2)
            date += `@${year}-${month}-${day}`

            startTime += '@' + info.rt_parse.lines.Line[index].StartTime.text
            arriveTime += '@' + info.rt_parse.lines.Line[index].ArriveTime.text
            flightName += '@' + airlines.find(item => item.includes(info.rt_parse.lines.Line[index].AirLine.text.slice(0, 2))).slice(0, -4)
            flightNum += '@' + info.rt_parse.lines.Line[index].AirLine.text
            mode += '@直飞'
          } else {
            terminal = info.rt_parse.lines.Line[index].ST.text ?? ''
            Aterminal = info.rt_parse.lines.Line[index].AT.text ?? ''
            let year = new Date().getFullYear()
            let month = dateArr.find(item => item.value.toUpperCase() === info.rt_parse.lines.Line[index].Date.text.slice(2, 5)).name
            let day = info.rt_parse.lines.Line[index].Date.text.slice(0, 2)
            date = `${year}-${month}-${day}`
            startTime = info.rt_parse.lines.Line[index].StartTime.text
            arriveTime = info.rt_parse.lines.Line[index].ArriveTime.text
            //航司二字
            flight = /\w{2}/.exec(info.rt_parse.lines.Line[index].AirLine.text)[0]
            flightName = airlines.find(item => item.includes(flight)).slice(0, -4)
            flightNum = info.rt_parse.lines.Line[index].AirLine.text
            mode = '直飞'
          }
        })
        _d.querySelector(`#pop_xc`).value = city
      }

      _d.querySelector(`#pop_cfd`).value = `${departureCity}`
      _d.querySelector(`#pop_cfhzl`).value = `${terminal}`
      _d.querySelector(`#pop_mdd`).value = `${destinationCity}`
      _d.querySelector(`#pop_ms`).value = `${mode}`
      _d.querySelector(`#pop_mddhzl`).value = `${Aterminal}`
      _d.querySelector(`#pop_qcrq`).value = `${date}`
      _d.querySelector(`#pop_qcsj`).value = `${startTime}`
      _d.querySelector(`#pop_ddsj`).value = `${arriveTime}`
      _d.querySelector(`#pop_hkgs`).value = `${flightName}`
      _d.querySelector(`#pop_hbbh`).value = `${flightNum}`
      //end


      document.querySelector('#upset_curry').value = currencyType;
      if (info.rt_parse.passengers.passenger?.length) {
        //多人
        info.rt_parse.passengers.passenger.forEach((item, index) => {
          setUserInfo(item, flight, index, rawDataText, userCount)
          userCount++
        })
      } else {
        //单人
        setUserInfo(info.rt_parse.passengers.passenger, flight, 0, rawDataText, userCount)
        userCount++
      }
    }
    func && func()
  }

  /**
   * 封装请求
   * @param url
   * @param method
   * @param data
   * @returns {Promise<unknown>}
   */
  function runAsync(url, method, data) {
    return new Promise((resolve, reject) => {
      GM_xmlhttpRequest({
        method: method,
        url: url,
        headers: {
          'Content-Type': 'application/json;charset=utf-8'
        },
        data: data,
        onload: function (response) {
          resolve(response.response);
        },
        onerror: function (err) {
          reject(err);
        }
      })
    })
  }


  /**
   * XML转JSON对象
   * @param xml
   * @returns {{}}
   */
  function xmlToJson(xml) {
    var obj = {};

    if (xml.nodeType == 1) {
      // 节点是元素
      if (xml.attributes.length > 0) {
        obj["@attributes"] = {};
        for (var i = 0; i < xml.attributes.length; i++) {
          var attribute = xml.attributes.item(i);
          obj["@attributes"][attribute.nodeName] = attribute.nodeValue;
        }
      }
    } else if (xml.nodeType == 3) {
      // 节点是文本
      obj = xml.nodeValue;
    }

    if (xml.hasChildNodes()) {
      // 节点有子节点
      for (var i = 0; i < xml.childNodes.length; i++) {
        var item = xml.childNodes.item(i);
        var nodeName = item.nodeName;
        if (nodeName === "#text") {
          nodeName = 'text';
        }


        if (typeof obj[nodeName] == "undefined") {
          obj[nodeName] = xmlToJson(item);
        } else {
          if (typeof obj[nodeName].push == "undefined") {
            var old = obj[nodeName];
            obj[nodeName] = [];
            obj[nodeName].push(old);
          }
          obj[nodeName].push(xmlToJson(item));
        }
      }
    }
    return obj;
  }

  /**
   * 设置用户信息
   * @param _info
   * @param flight
   * @param index
   * @param userInfo
   * @param count
   */
  function setUserInfo(_info, flight, index, userInfo, count) {
    index = Number(index)
    const re = new RegExp(`SSR DOCS.*\\/P${index + 1}`)
    userInfo = re[Symbol.match](userInfo)

    // console.log(re);
    // console.log(userInfo);

    const ticket = _info['Ticket']?.text
    let prefix = ''
    let suffix = ''
    let prefixValue = 0
    let flightValue = 0
    const username = _info['Name'].text
    let dateOfBirth = ''
    let cid = ''
    let validity = ''

    if (ticket) {
      prefix = _info['Ticket'].text?.slice(0, 3)
      suffix = _info['Ticket'].text?.slice(3, 13)
    } else {
      let p = document.createElement('p')
      p.innerText = '暂无票号'
      p.style.color = 'red'
      let td = document.querySelector(`#flights_num_three${count}`)
      td.parentNode.insertBefore(p, td.nextSibling)
    }

    if (userInfo) {
      userInfo = userInfo[0].split('/')
      // console.log(userInfo);
      //证件有效期
      let validityYear = userInfo[6].slice(-2)
      let validityMonth = dateArr.find(i => i.value.toUpperCase() === userInfo[6].slice(2, 5)).name
      let validityDay = userInfo[6].slice(0, 2)
      validity = `20${validityYear}-${validityMonth}-${validityDay}`
    }

    for (const child of _d.querySelector(`#flights_num_one${count}`).children) {
      if (child.innerHTML == flight) {
        flightValue = child.value
        break
      }
    }
    for (const child of _d.querySelector(`#flights_num_two${count}`).children) {
      if (child.innerHTML == prefix) {
        prefixValue = child.value
        break
      }
    }

    if (info.rt_parse['HasNI'].text === "0") {
      cid = userInfo[2]
      _d.querySelector(`select[name=product_category]`).value = 41;
    } else {
      if (_info['NI']?.text) {
        dateOfBirth = `${_info['NI'].text.slice(6, 10)}-${_info['NI'].text.slice(10, 12)}-${_info['NI'].text.slice(12, 14)}`
        cid = _info['NI'].text
      } else {
        let p = document.createElement('p')
        p.innerText = '暂无证件号'
        p.style.color = 'red'
        let td = document.querySelector(`#credentials${count}`)
        td.parentNode.insertBefore(p, td.nextSibling)
      }
      _d.querySelector(`select[name=product_category]`).value = 40;
    }


    _d.querySelector(`#flights_num_one${count}`).value = flightValue
    _d.querySelector(`#flights_num_two${count}`).value = prefixValue
    _d.querySelector(`#flights_num_three${count}`).value = suffix
    _d.querySelector(`#flights_name_en${count}`).value = username
    _d.querySelector(`#credentials${count}`).value = cid

    if (dateOfBirth) {
      _d.querySelector(`#flights_birht${count}`).value = dateOfBirth
    }
    if (validity) {
      _d.querySelector(`#bed_num${count}`).value = validity
    }
  }


  // 检查更新
  function checkForUpdates() {
    GM_xmlhttpRequest({
      method: 'GET',
      url: 'https://greasyfork.org/scripts/472387',
      onload: function (response) {
        const matches = response.responseText.match(/version="([\d+\.]+\d+)/);
        if (matches) {
          const currentVersion = GM_info.script.version;
          const scriptId = '472387';
          const greasyForkUrl = 'https://greasyfork.org/scripts/' + scriptId;
          const latestVersion = matches[1];
          if (latestVersion !== currentVersion) {
            showUpdateNotification(' 已更新到版本 ' + latestVersion + '点击下载更新。')
          }
        }
      }
    });
  }


  // 弹出更新通知
  function showUpdateNotification(text) {
    const a = document.createElement('a')
    a.href = 'https://greasyfork.org/scripts/472387-%E6%95%B0%E6%8D%AE%E8%87%AA%E5%8A%A8%E5%BD%95%E5%85%A5/code/%E6%95%B0%E6%8D%AE%E8%87%AA%E5%8A%A8%E5%BD%95%E5%85%A5.user.js'
    a.innerText = text
    a.style = "position: fixed;top: 10%;right: 5%;border: 1px solid #d9d9d9;padding: 10px 20px;background: #f0f0f0;text-decoration: none;color:#000;"
    a.target = "_blank"
    document.body.appendChild(a);
  }

